import Col from 'react-bootstrap/Col';
import Button from 'react-bootstrap/Button';
import { CarouselItem} from 'react-bootstrap';
import img1 from './images/img1.png';
import img2 from './images/img2.png';
import img3 from './images/img3.png';
import img4 from './images/img4.jpg';
import img5 from './images/img5.png';
import img6 from './images/img6.png';



function Homepage() {
  return (
<Carousel>
      <CarouselItem>
        <img className="nature" alt="homeimages" src={img1}/>
      </CarouselItem>
      <CarouselItem>
      <img className="nature" alt="homeimages" src={img2}/>
      </CarouselItem>
      <CarouselItem>
        <img className="nature" alt="homeimages" src={img3}/>
      </CarouselItem>
      <CarouselItem>
        <img className="nature"  alt="homeimages" src={img4}/>
      </CarouselItem>
      <CarouselItem>
        <img className="nature" alt="homeimages"  src={img5}/>
      </CarouselItem>
      <CarouselItem>
        <img className="nature" alt="homeimages" src={img}/>
      </CarouselItem>

    </Carousel>
   )}

   export default Homepage
